use crate::*;

const DEFAULT_ICON: &str = "data:image/png;base64,";
const TOKEN_TITLE: &str = "HotOrBot NFT";
const TOKEN_DESCRIPTION: &str = "HotOrBot NFT Winner's Proof";
const TOKEN_MEDIA: &str = "bafybeifvttgtqsuqu677f3u5o4yfxbocq2u6el37o2ho2sjkb4ny4vmpei";


#[near_bindgen]
impl Contract{
    pub fn nft_token(&self, token_id: TokenId) -> Option<Token> {
        let owner_id = self.tokens.owner_by_id.get(&token_id)?;
        let metadata = self.tokens.token_metadata_by_id.as_ref().and_then(|by_id| by_id.get(&token_id));
        Some(Token { token_id, owner_id, metadata, approved_account_ids: None })
    }

    #[payable]
    pub fn nft_transfer(&mut self) { panic!("Transfers prohibited") }

    #[payable]
    pub fn nft_transfer_call(&mut self) -> PromiseOrValue<bool> { panic!("Transfers prohibited") }
}

near_contract_standards::impl_non_fungible_token_enumeration!(Contract, tokens);

#[near_bindgen]
impl NonFungibleTokenMetadataProvider for Contract {
    fn nft_metadata(&self) -> NFTContractMetadata {
        self.metadata.get().unwrap()
    }
}

impl Contract {
    pub fn internal_mint(&mut self, owner_id: &AccountId) -> Token {
        let token = self.tokens.internal_mint(
            format!("HotOrBot-{}", self.next_token_id),
            owner_id.to_owned(),
            Some(TokenMetadata {
                title: Some(TOKEN_TITLE.to_string()),
                description: Some(TOKEN_DESCRIPTION.to_string()),
                media: Some(TOKEN_MEDIA.to_string()),
                media_hash: None,
                copies: None,
                issued_at: None,
                expires_at: None,
                starts_at: None,
                updated_at: None,
                extra: None,
                reference: None,
                reference_hash: None,
            }));

        self.next_token_id += 1;
        token
    }
}

pub fn internal_get_metadata() -> NFTContractMetadata {
    NFTContractMetadata {
        spec: NFT_METADATA_SPEC.to_string(),
        name: "HotOrBot NFT".to_string(),
        symbol: "HOT-OR-BOT".to_string(),
        icon: Some(DEFAULT_ICON.to_string()),
        base_uri: None,
        reference: None,
        reference_hash: None,
    }
}